import React, { useState } from 'react';
import { Link, useHistory } from 'react-router-dom';

const RegisterPage = () => {
    const [formData, setFormData] = useState({
        email: '',
        password: '',
        firstName: '',
        lastName: '',
        phoneNumber: '',
    });

    const history = useHistory(); // Used to navigate after successful registration

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();

        // Send registration data to the backend
        fetch('/register', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(formData),
        })
        .then(response => {
            if (response.status === 200) {
                // Registration was successful, you can navigate to a different page
                history.push('/login'); // Redirect to the login page after successful registration
            } else {
                // Handle registration error (e.g., display an error message)
            }
        })
        .catch(error => {
            // Handle fetch error
            console.error('Registration error:', error);
        });
    };

    return (
        <div>
            <h2>Register</h2>
            <form onSubmit={handleSubmit}>
                {/* ... (form fields) */}
                <button type="submit">Register</button>
            </form>
            <p>Already have an account? <Link to="/login">Log in</Link></p>
        </div>
    );
};

export default RegisterPage;
